  styleUrls: ['./movies.component.css']
})
export class MoviesComponent {
   moviePosters=['assets/movie-imgs/poster 1.png','assets/movie-imgs/poster 2.png','assets/movie-imgs/poster 3.png','assets/movie-imgs/poster 1.png','assets/movie-imgs/poster 2.png','assets/movie-imgs/poster 3.png']
   movieDetails:any[]=[]
   constructor(private dataservice:MovieService){}
   ngOnInit(){this.dataservice.getposts().subscribe((res)=>{
       this.movieDetails=res
      console.log(this.movieDetails)
     })
   }
}
